import React, { useState } from "react";
import {
  alpha,
  ThemeProvider,
  withStyles,
  makeStyles,
  createTheme,
} from "@material-ui/core/styles";
import TextField from "@material-ui/core/TextField";
import { green } from "@material-ui/core/colors";
import Grid from "@material-ui/core/Grid";
import Button from "@material-ui/core/Button";
import { Container } from "@material-ui/core";

const useStyles = makeStyles((theme) => ({
  //root: {
  //   display: "flex",
  //   flexWrap: "wrap",
  // },
  // margin: {
  //   margin: theme.spacing(2),
  //   width: "350px",
  // },
  // button: {
  //   "& > *": {
  //     margin: theme.spacing(2),
  //   },
  // },
}));

const theme = createTheme({
  palette: {
    primary: green,
  },
});

export default function CustomizedInputs() {
  const classes = useStyles();

  // let [locdata, setlocdata] = useState();

  // let handleChange = ({ target }) => {
  //   setlocdata(target.value);
  // };

  // let findebus = () => {
  //   alert(locdata);
  // };

  let inputUrduc = React.createRef();
  let inputUrde = React.createRef();

  function texapoxvel() {
    let urduc = inputUrduc.current.value;
    let urde = inputUrde.current.value;
    alert(`Texapoxvum enq ${urduc}-ic ${urde}`);
  }

  return (
    <Container>
      <Grid
        container
        className={classes.container}
        direction="column-reverse"
        justifyContent="flex-end"
        alignItems="baseline"
      >
        <Grid item className={classes.input1}>
          <ThemeProvider theme={theme}>
            <TextField
              className={classes.margin}
              label="Urde"
              variant="outlined"
              id="mui-theme-provider-standard-input"
              inputRef={inputUrde}
            />
          </ThemeProvider>
        </Grid>
        <Grid item className={classes.input2}>
          <ThemeProvider theme={theme}>
            <TextField
              className={classes.margin}
              label="Urduc"
              variant="outlined"
              id="mui-theme-provider-outlined-input"
              // value={locdata}
              // onChange={handleChange()}
              inputRef={inputUrduc}
            />
          </ThemeProvider>
        </Grid>
        <div className={classes.button}>
          <Button
            variant="contained"
            style={{
              backgroundColor: "#008B8B",
              color: "white",
              width: "350px",
              boxShadow: `2px 2px 10px #008B8B`,
            }}
            onClick={texapoxvel}
          >
            GO-i knopken
          </Button>
        </div>
      </Grid>
    </Container>
  );
}
